import { useEffect } from "react";

const useSearchByBarcode = (barcode) => {
    // useEffect(() => {
        
        fetch('http://example.com/songs')
        .then(response => response.json())
        .then(data => {
            const result = data.find(item => item.barcode === barcode);
    
        })
        .catch(err => console.error(err));
    // })

    
    return ;
}

export default useSearchByBarcode;
